import React, { useState, useEffect } from 'react';

const [data, setData] = useState([
    {"event":"Pot des caves","position":{ "name":"Duplex", "lat":48.873658, "lng": 2.292500 },"couvreurs":["Emma"," Tara"]},
    {"event":"JOB","position":{ "name":"Palais royal", "lat":48.865045, "lng": 2.337404 },"couvreurs":["Eloi"," Thomas"]},
    {"event":"Afterwork JEECE","position":{ "name":"Square St Eloi", "lat":48.844737, "lng": 2.387503 },"couvreurs":["Nina"," Mathieux"]}
]);

//Give the next workers for the next 3 events or less if less programmed
export default function NextWorker(){

    var actual = -1;

    

    return (

        <div className='container'>
            {line}
            <div className='event'>
                <h1 className='eventTitle'>{data[1].event}</h1>
                <h5 className='couvreurs'>Couvert par : {data[1].couvreurs}</h5>
                <h5 className='position'>Lieu : {data[1].position.name}</h5>
            </div>
            <div className='event'>
                <h1 className='eventTitle'>{data[2].event}</h1>
                <h5 className='couvreurs'>Couvert par : {data[2].couvreurs}</h5>
                <h5 className='position'>Lieu : {data[2].position.name}</h5>
            </div>
        </div>

    );
}

function line(){

    return(
        <div className='event'>
                <h1 className='eventTitle'>{data[0].event}</h1>
                <h5 className='couvreurs'>Couvert par : {data[0].couvreurs}</h5>
                <h5 className='position'>Lieu : {data[0].position.name}</h5>
            </div>
    );

}
